import './App.css'
import { BrowserRouter ,Routes,Route,Link} from "react-router-dom";
import Comp1 from './components/Comp1';
function App(){
  return(
    <BrowserRouter>
    <div className='prnt'> 
        <nav className='content'>
            <Link to='/'>Home</Link>
            <Link to='/Comp1'>Comp1</Link>
        </nav>
      <div>
        <Routes>
          <Route exact path='/About' element={<C/>} />
        </Routes>
      </div>
      <footer className='text-center bg-dark p-3 text-white mt-5 '>information</footer>
    </div>
    </BrowserRouter>
  )
}
export default App
